class Solution:
    def validPalindrome(self, s: str) -> bool:
        start=0
        last=len(s)-1
        while start<last:
            if s[start]==s[last]:
                start+=1
                last-=1
            else:
                return s[start:last]==s[start:last][::-1] or s[start+1:last+1]==s[start+1:last+1][::-1]
        return True